import React from 'react';  
import './App.css';
import {BrowserRouter as Router,Switch,Route} from "react-router-dom";



function App() {
  return (
    <Router>
      <div className="App">
       <Switch>
         <Route path ="/Visit">
           <h1>Visit Reatailer</h1>
         </Route>
         <Route path = "/Settings">
           <h1>Account Details</h1>
         </Route>
         <Route path = "/">
           <h1>Home page</h1>
         </Route>


       </Switch>
      </div>
    </Router>

    );
  }

export default App;
